import './App.css';
import Header from './components/Header';

const initialTasks = [
  { id: 1, text: "Learn React" },
  { id: 2, text: "Do homework" },
  { id: 3, text: "Cook dinner" },
];

function App() {
  return (
    <div className="App">
      <Header />
      <ul>
        {initialTasks.map(task => (
          <li key = {task.id}>{task.test}</li>
        ))
        }
      </ul>
    </div>
  );
}

export default App;
